import React, { useState } from 'react'

function Dish(props) {
    const [editDish, setEditDish] = useState();
    const { dish } = props;

    return (
        <>
            <tr>
                <td>{dish.name}</td>
                <td>{dish.desc.slice(0, 10)}...</td>
                <td>{dish.category}</td>
                <td>{dish.subcategory}</td>
                <td>{dish.price}</td>
                <td>{dish.status}</td>
                <td className='text-center'><button className="btn btn-primary" data-bs-toggle="modal" data-bs-target="#edit" onClick={() => setEditDish(dish)}>Edit</button></td>
            </tr>
        </>
    )
}

export default Dish
